import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expense = [
    {
      id:'e1',
      title: "Toilet Paper",
      amount: 94.17,
      date: new Date(2021, 2, 28),
    },
    {
      id:'e2',
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id:'e3',
      title: "Rent",
      amount: 100.17,
      date: new Date(2021, 2, 28),
    },
  ];

  return (
    <div>
      <ExpenseItem
      title={expense[0].title}
      amount={expense[0].amount}
      date={expense[0].date}
      ></ExpenseItem>
       <ExpenseItem
      title={expense[1].title}
      amount={expense[1].amount}
      date={expense[1].date}
      ></ExpenseItem>
     <ExpenseItem
      title={expense[2].title}
      amount={expense[2].amount}
      date={expense[2].date}
      ></ExpenseItem>
    </div>
  );
}

export default App;
